import React, { useState } from 'react';

function About() {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hello! My name is Jane Doe and I am a web developer.</p>
    </div>
  );
}
function Portfolio() {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hello! My name is Jane Doe and I am a web developer.</p>
    </div>
  );
}

function contact() {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hello! My name is Jane Doe and I am a web developer.</p>
    </div>
  );
}

function App() {
  const [showAbout, setShowAbout] = useState(false);

  const handleAboutClick = () => {
    setShowAbout(!showAbout);
  };

  return (
    <div id="infoCard" class="card">
      <nav class="navbar">
        <form class="container-fluid justify-content-end">
          <button id="btn" class="btn btnAbout" type="button" onClick={handleAboutClick}>
            About
          </button>
          <button id="btn" class=" btn btnPortfolio" type="button">
            Portfolio
          </button>
          <button id="btn" class=" btn btnContact" type="button">
            Contact
          </button>
        </form>
      </nav>
      <div id="root" class="card-body">
        {showAbout && <About />}
      </div>
    </div>
  );

}

export default App;
